import React from 'react';
import {StyledFormInputAdd, StyledButtonForm, StyledForm} from "./AddItem.styled";

const AddItem = ({addItems}) => {
    return (
        <StyledForm onSubmit = { () => addItems() }>
            <StyledFormInputAdd type="text" placeholder='enter new task'/>
            <StyledButtonForm>Add</StyledButtonForm>
        </StyledForm>
    )
};

export default AddItem;
